import "./Body.css"
import BodyHeader from '../BodyHeader/Bheader';
import BodyLeft from '../BodyLeft/BodyLeft';
import BodyCenter from '../BodyCenter/BodyCenter';
import BodyRight from '../BodyRight/BodyRight';


const Body = ()=>{
    return(
        <div className='Body'>
            <BodyHeader />
            < div className="subBody">
            <BodyLeft />
            <BodyCenter />
            <BodyRight />

            </div>
        </div>
    )
}

export default Body
